const canvas = document.getElementById('htmlCanvas');
const ctx = canvas.getContext('2d');


const cWidth = canvas.width = 800;
const cHeight = canvas.height = 500;


// set image souece...
const img = new Image();
// img.src = 'mountFuji.jpg'; // The canvas has been tainted by cross-origin data.
img.src = 'data:image/jpeg;base64,'


// image loaded events...
img.addEventListener('load', e => {

    // draw image inside canvas...
    ctx.drawImage(img, 0, 0, cWidth, cHeight);

    // get drawn image data from canvas...
    const scanImg = ctx.getImageData(0, 0, cWidth, cHeight);
    const imgData = scanImg.data;
    const imgDataLength = imgData.length;

    // read this image raw data...
    for (let i = 0; i < imgDataLength; i += 4) {

        // get rgb pixel data value...
        let r = imgData[i];
        let g = imgData[i + 1];
        let b = imgData[i + 2];

        // get total rgb color value...
        const total = r + g + b;

        const avarageColorValue = total / 3;

        const rValue = 100
        const gValue = 10
        const bValue = 100

        // edit/update existing image color values...
        imgData[i] = avarageColorValue - rValue;
        imgData[i + 1] = avarageColorValue + gValue;
        imgData[i + 2] = avarageColorValue - bValue;
    }

    // update origanal image data source...
    scanImg.data = imgData;
    ctx.putImageData(scanImg, 0, 0); // back to image data inside canvas...
})


